//Credit: https://kyrise.itch.io/kyrises-free-16x16-rpg-icon-pack
import GreatHpPotionImg from './great-hp-potion.png';

const GreatHpPotion = {
  name: 'Great Health Potion',
  type: 'potion',
  kind: 'health',
  hp: 40,
  hpReset: 40,
  image: GreatHpPotionImg,
  value: 80,
};

export default GreatHpPotion;
